import React, { Component } from 'react'

class sem_list extends Component {
    render() {
        return (
            <div>
               
                <form >
                    <label >
                        No of Courses {this.props.i}
                        <input className='course_no_input' type="number" max='10'/>
                    </label>
                </form>
            </div>
        )
    }
}

export default sem_list
